import React, { Component } from 'react'

export default  () => {
    const handleSubmit = () => {
        alert()
    }
    return(
        <form onSubmit={handleSubmit} >
            let username;
            let password
            <lable>username:
                <input 
                    type="text" 
                    placeholder="username" 
                    ref={ input => this.username = input }
                />
            </lable>
            <label>password:
                <input 
                    type="password"
                    placeholder="password" 
                    ref={ input => this.password = input }
                />
            </label>
            <input type="submit" values="login" />
        </form>
    ) 
}
